%[text] # Create Building Simscape Library from XML Part
%[text] Copyright 2025 - 2026 The MathWorks, Inc.
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] In this workflow, you will learn how to use a building part file, generated in [Create Building Model Part Using Utilities](file:./CreateBuildingModelPart.mlx), to automatically create a Simscape building. The utilities leverage `Simscape Custom Libraries` to create the building model automatically. 
%[text] ![](text:image:9fd7)
%[text] In the section below, you learn how to create the Simscape building library model using the utility function `createBuildingLibraryAndParameterize`. The function reads the build part-file and recreates the geometry and parameterizes them.
%[text] To see all `Simscape Custom Library` options, on the **MATLAB Command Prompt**, run the function `openCustomLib`, as shown below.
%[text] ```matlabCodeExample
%[text] openCustomLib
%[text] ```
%[text] ## Specify Material Properties
%[text] Specify building material properties and piping dimension, which are not included in the building part XML file. Use the `initializeBuildingData` function to specify values for building walls, roof, floors, and coolant piping, if present. 
[wallMatProp,pipingData] = initializeBuildingData(... %[output:group:5086350d] %[output:3cac5a3c]
    ModelType="Heat Load Analysis",... %[output:3cac5a3c]
    ExternalWallMaterial="Concrete",... %[output:3cac5a3c]
    ExternalWallThickness=simscape.Value(0.07,"m"),... %[output:3cac5a3c]
    InternalWallMaterial="ClinkerBrick",... %[output:3cac5a3c]
    InternalWallThickness=simscape.Value(0.04,"m"),... %[output:3cac5a3c]
    FloorMaterial="Brick",... %[output:3cac5a3c]
    FloorThickness=simscape.Value(0.03,"m"),... %[output:3cac5a3c]
    RoofMaterial="Concrete",... %[output:3cac5a3c]
    RoofThickness=simscape.Value(0.04,"m"),... %[output:3cac5a3c]
    WindowGlassThickness=simscape.Value(0.005,"m"),... %[output:3cac5a3c]
    Diagnostics=true); %[output:group:5086350d] %[output:3cac5a3c]
%[text] The function outputs two tables, one for wall material properties and the other for piping information. You can edit these table parameters based on your requirements. By default, there are four wall material options. You can choose to select from the provided wall material options or specify values of your own choice.
%%
%[text] ## Create Building Library
%[text] Use the `createBuildingLibraryAndParameterize` function to create and parameterize the building library. The building library is constructed based on dimension data provided in the name-value pair `BuildingPartFile`. You must specify building material properties name-value pairs `WallMaterialTable` and `PipingDataTable`. The material property tables are the output of the function `initializeBuildingData`, described in [Specify Building Material Properties](internal:M_8ecf). You must also provide Simscape name-value pairs for thermal modeling:
%[text] - **IniBuildingTemperature** specifies building initial temperature.
%[text] - **GroundThermalRes** specifies thermal resistance to ground.
%[text] - **HeatTransferCoeffExt** specifies heat transfer coefficient values between environment and building external walls.
%[text] - **HeatTransferCoeffInt** specifies heat transfer coefficient values inside the rooms. \
modelData.buildingPartFile = "BuildingModelPartUsingUtilities.xml";
modelData.myLibraryName = "BuildingThermal";

bldgBlockPath = createBuildingLibraryAndParameterize(... %[output:group:2b7f7a4e] %[output:3de06c09]
    ModelType="Heat Load Analysis",... %[output:3de06c09]
    BuildingPartFile=modelData.buildingPartFile,... %[output:3de06c09]
    BuildingLibraryName=modelData.myLibraryName,... %[output:3de06c09]
    IniBuildingTemperature=simscape.Value(300,"K"),... %[output:3de06c09]
    GroundThermalRes=simscape.Value(1,"K/W"),... %[output:3de06c09]
    HeatTransferCoeffExt=simscape.Value(20,"W/(K*m^2)"),... %[output:3de06c09]
    HeatTransferCoeffInt=simscape.Value(30,"W/(K*m^2)"),... %[output:3de06c09]
    WallMaterialTable=wallMatProp,... %[output:3de06c09]
    PipingDataTable=pipingData,... %[output:3de06c09]
    SaveModel="Create Model",... %[output:3de06c09]
    Diagnostics=true); %[output:group:2b7f7a4e] %[output:3de06c09]
%[text] Specify the library name using the name-value pair `BuildingLibraryName`. Set `Diagnostics` to *true* to display progress for the build phase. Specify name-value pair `ModelType` as *Heat Load Analysis* or *Building Energy System (TL)*. The *Heat Load Analysis* is useful for simulating for energy analysis for long period of time. To add HVAC elements like a radiator or underfloor piping to building rooms, use *Building Energy System (TL)*. This is useful when designing controllers for specific applications.
%[text] To save your work, use the name-value pair `SaveModel` to:
%[text] - *Create Model*: Create a model to check if everything looks as expected. This step does not save the model library.
%[text] - *Create Model and Save*: Create the model and save it in the **ScriptsData/BuildingLib** directory. You must manually add the saved library to project path.
%[text] - *Create Model and Save With Icon*: Create the model and save it along with a library icon in the **ScriptsData/BuildingLib** directory. You must manually add the saved library to project path.
%[text] - *Create Model, Save With Icon, and Update Path*: Create the model, add to project path, and save it along with a library icon in the **ScriptsData/BuildingLib** directory. Confirm that the files are added to project path. \

